import About from "./About.js";
import Login from "./Login.js";
import Main from "./Main.js";




function App() {


    return(
    <div className="App">

       <Routes>
       <Route path="/" element={<Main/>} />

       </Routes>  




    </div>
    );
};

export default App ;
